import React, { Fragment } from 'react';
import Layout from '../components/Layout';
import styled  from 'styled-components';


const CreaImagen = styled.div`
    background-size: cover;
    width: 100%;
    height: 300px;
`
const ComparteImagen = styled.div`
    background-size: cover;
    width: 100%;
    height: 300px;
`
const ConectaImagen = styled.div`
    background-size: cover;
    width: 100%;
    height: 300px;
`


const Index = ({children}) => (
    <Fragment>
        <Layout /> 
        {children}
        <div className="container mt-5 mb-5">
            <div className="row">
                <div className="col-12 col-md-4">
                    <p>Crear</p>
                    <CreaImagen className="creaImagen" />
                </div>
                <div className="col-12 col-md-4">
                    <p>Comparte</p> 
                    <CreaImagen className="comparteImagen" />
                    
                </div>
                <div className="col-12 col-md-4">
                    <p>Comenta</p> 
                    <CreaImagen className="comentaImagen" />
                    
                </div>
            </div>
        </div>
        
    </Fragment>
   
  )
  
  export default Index
